import React from "react";

import Directory from "../../components/directory/directory.component";
import './homepage.style.css'

const HomePage = (props) => {
  return (
    <div className="homepage-display-grid">
      <div className="homepage-display-flex">
        <div className='homepage-display-items'>
        <img src=' https://images.ctfassets.net/5de70he6op10/6jZ55m4laSQ27tvuIAb205/a881f1e6487322d9da1a8e59314ea31a/011121_HPG_LS_1.jpg' width='825' height='550'/>
        </div>
        <div className="homepage-display-split">
          <h1>Image 2</h1>
          <h1>Image 3</h1>
        </div>
        <div className='homepage-display-items'>
        <img src='   https://media.architecturaldigest.com/photos/598dd880cb4a1b70eb61ac1e/16:9/w_2560%2Cc_limit/Entrance-Atrium-with-plant.jpg' width='825' height='550'/>
        </div>
      </div>
      <div className="homepage-display-flex">
        <img src='https://i1.wp.com/artmyideas.com/wp-content/uploads/2018/12/50-Beautiful-Bedroom-Wall-Art-Ideas-And-Decorations-16.jpg?w=1200&ssl=1'width='290'height='370'/>
        <img src='https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/beautiful-festive-hand-made-candles-and-a-wooden-royalty-free-image-1601566745.jpg?crop=0.590xw:0.883xh;0.173xw,0.0611xh&resize=980:*'width='290'height='370'/>
      </div>
    </div>
  );
};

export default HomePage;
